// App.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import routes from './routes';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {routes.map((route, index) => (
          <Route key={index} path={route.path} element={<route.element />} exact={route.exact} />
        ))}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
